function CurrDate(){
const current = new Date();
const month = (current.getMonth()+1).toLocaleString('en-us', { month: 'long' });;
const day = current.getDate().toLocaleString('en-US', {day: '2-digit'});
const year = current.getFullYear().getFullYear;


return(
<div>
    <div className='box'>
        <div className='date_box'>
            <div>{month}</div>   
            <div>{day} </div>   
            <div>{year}</div>             
        </div>
    </div> 
</div>);
}

export default CurrDate;
